export default function StarRating(starCount) {
  const maxStars = 10;
  const fullStar = (
    <i className="la-star" style={{ color: "#e1ec0d" }} >
      {" "}
    </i>
  );
  const emptyStar = <i className="lar la-star" ></i>;

  const roundedStarCount = Math.round(starCount.starCount * 2);
  const stars = [];
  for (let i = 1; i <= maxStars; i++) {
    if (i <= roundedStarCount) {
      stars.push(<span key={`star-${i}`}>{fullStar}</span>);
    } else {
      stars.push(<span key={`star-${i}`}>{emptyStar}</span>);
    }
  }
  return <>{stars}</>;
}
